window.bookSummaryJSON = "<p><b>From the award-winning and </b><b><i>New York Times</i></b><b> best-selling author of&nbsp;</b><b><i>The Rest of the Story </i></b><b>comes a moving novel about the power of finding and speaking your truth.</b></p> <p>When she’s modeling, Annabel Greene is the picture of perfection - the girl who has everything.</p> <p>But her real life is far from perfect. Her best friend, Sophie, and she are no longer speaking; her older sister’s eating disorder is affecting everything at home.</p> <p>Then she meets Owen. He’s intense, music-obsessed, and dedicated to always telling the truth.</p> <p>And most of all, he’s determined to make Annabel happy....</p> <p><b>“This is young adult fiction at its best.” (</b><b><i>School Library Journal</i></b><b>)</b></p>"; 
